import React from 'react'
import HomeApp from './components/Homebox/Home/home';
import './index.css';
// import Home from './components/Homebox/homeBox'
import OrderBoxNav from './components/OrderBox/orderBox'
import ServicesNav from './components/Services/servicesNav'
import ShopNav from './components/Shop/shopNav';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";
import FeaturesNav from './components/Features/FeaturesNav';

// import ShopNav from '../../../Shop/shopNav'

function App() {
  return (
    <div>
      <Router>
                    <Switch>
                        <Route path="/" exact component={HomeApp}></Route>
                        <Route path="/features" component={FeaturesNav}></Route>
                        <Route path="/Services" component={ServicesNav}></Route>
                        <Route path="/Shop" component={ShopNav}></Route>
                        <Route path="/OrderBox" component={OrderBoxNav}></Route>


                    </Switch>
            </Router>

      {/* <HomeApp/> */}
    </div>
  );
}

export default App;
